import React from 'react';

export default function Search() {
    return (
        <div>
            <div className="content">
        <div className="container">
          <section className="section">
            <ul>
              {this.state.list.map(item => (
                <li key={item}>{item}</li>
              ))}
            </ul>
          </section>
        </div>
      </div>
        </div>
    )
}
